import './App.css';

function App() {
  const planets = [
    {name: "Mars", isGasPlanet: false},
    {name: "Earth", isGasPlanet: false},
    {name: "Jupiter", isGasPlanet: true},
    {name: "Venus", isGasPlanet: false},
    {name: "Neptune", isGasPlanet: true},
    {name: "Mars", isGasPlanet: false},
  ];
  return (
    <div className="App">
      <User name="Pooja" age={26} email="pooh@p.n"/>
      <User name="Neha" age={23} email="neh@p.n"/>
      <User name="Manjunath" age={60} email="manju@p.n"/>
      <User name="Surekha" age={50} email="surek@p.n"/>
    </div>
  );
}

const User = (props) => {
  return (
    <div>
      <h1>{props.name}</h1>
      <h1>{props.age}</h1>
      <h1>{props.email}</h1>
    </div>
  );
}

export default App;
